    "Development of Fast Response SME TiNi Foam Torque Tubes Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:17:03.479300",nt"name": "development-of-fast-response-sme-tini-foam-torque-tubes-project",nt"isopen":
    true,nt"url": null,nt"notes": "Shape Change Technologies (SCT) has pioneered
    the use of Self-propagating High Temperature Synthesis (SHS) to manufacture open
    celled, porous TiNi.  Recently, we have been able to demonstrate the shape memory
    effect  in these foams, which is a unique capability.   Unlike solid, monolithic
    TiNi, the open-celled foam structure allows for very rapid response times when immersed
    in fluids, such as hot water or hot air. The SHS process makes net shape components,
    and so the cost of the tube can be dramatically reduced, and can have features introduced
    into the end of the tube to allow for simple torque transfer into a structure.  Thus,
    in developing a foam torque tube using SHS, all of the key obstacles to its incorporation
    into existing aerostructures can be resolved, while preserving the key benefits
    of a lightweight, solid-state structure. ",nt"license_title": "U.S. Government
